import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class InfoWindow extends Component {

  injectInfo(e, pass, error) {
    if (pass) {
      ReactDOM.render(
        <div className="info-window-display">Success!</div>,
        document.getElementById(`${this.props.loc.title}`)
      )
    } else {
      ReactDOM.render(
        <div className="info-window-display">Error {error}</div>,
        document.getElementById(`${this.props.loc.title}`)
      )
    }
  }

  componentDidMount() {
    fetch(`https://api.foursquare.com/v2/venues/explore?client_id=BITALC3HSA4PLMTBLQXFRKDYX1Y0SCCWFBMWZC2SW2CTKJFW&client_secret=ESBUR3GBTUWVOYGUWQ4BGET0A3DGI0VYQTWCS2H1RU5CPK2W&v=20180323&limit=1&ll=this.props.loc.location.lat,this.props.loc.location.lng&query=coffee`)
    .then((response) => {
        if (response.code === 200) {
          this.injectInfo(response, true, null);
        }
    })
    .catch((error) => {
      this.injectInfo(error, false, error);
    })
  }


  render() {
    return (
      //Empty div to be populated by props passed down
    // <div className="info-window">{props.title}</div>
    <div className="info-window">
      <div id={this.props.loc.title}></div>
    </div>
    )
  }
}


export default InfoWindow
